import React from 'react';
import { Route, Router } from 'react-router-dom';
import Home from './components/Home';
import About from './components/About';

function App() {
  return (
    <div className="App">
      <h1>hello</h1>

      <Router>
        <Route path="/Home" components={Home} />
        <Route path="/About" components={About} />
      </Router>
    </div>

  );
}

export default App;
